description:
Dear Diary,

Alian came back, as promised, to make some pictures of her. From the very start, she acted very shy about it and was even using the pillow to hide her face.

So, sad to say, we had to keep the filming simple this time, not right in her face.

Later in the night, I went to a disco to meet Xiao Cui. She taught me to play Chinese dice. ThatÃ¢â‚¬â„¢s useful for future dates. There were also some performances in the disco. Xiao cui was lovely, as always, so I had a good time with her.

Back in my room, I just made a few pics and then we went to sleep. I was too tired for more.

Tomorrow, another day.

